Cookie类setMaxAge过期时间
setMaxAge() 设置值大于0, 将cookie存储于本地磁盘, 过期后删除
setMaxAge() 设置值小于0, cookie不会保存于本地, 浏览器会话结束后, 将会删除, 经过在Mac上的chorme测试, 需要结束进程后cookie才会从内存中删除
setMaxAge() 设置值等于0, 立即删除cookie
